import React from 'react'

import { Card } from 'react-bootstrap';
import { Form } from 'react-bootstrap';

import '../assets/css/Registration.css';
import Inputs from '../components/Inputs'


export default class Registration extends React.Component{
    render(){
        return(
            <section className="reg">
                <div className="regWrapper">
                    <h1> Registration </h1>
                    <Card>
                        <Form>
                           <Inputs label="First Name" name="FirstName" type="text" placeholder="First Name" />
                           <Inputs label="Last Name" name="LastName" type="text" placeholder="Last Name" />
                           <Inputs label="Email Id" name="EmailId" type="email" placeholder="Email Id" />
                           <Inputs label="Password" name="Password" type="password" placeholder="Password" />
                           <Inputs label="" name="" type="" placeholder="" />
                           <Inputs label="" name="" type="" placeholder="" />

                        </Form>
                    </Card>
                </div>

            </section>

        )
    }
}
